import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { AccueilComponent } from './components/admin/pages/accueil/accueil.component';
import { DashboardComponent } from './components/admin/dashboard/dashboard.component';

const routes: Routes = [
  { path: 'accueil', component: AccueilComponent },  // Route pour la page d'accueil
  { path: 'dashboard', component: DashboardComponent },  // Route pour le tableau de bord
  { path: '', redirectTo: '/accueil', pathMatch: 'full' },  // Redirection par défaut vers accueil
  { path: 'dashbord', component: DashboardComponent }  // Ajoutez cette ligne pour la route 'dashbord'
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
